import React from 'react';
import '../css/Tab.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Tab = (props) => {
  return (
      <>
        <div className='tab row'>
             <FontAwesomeIcon icon={props.icon} size="3x"/>
            <p>{props.title}</p>
            <i class="fas fa-arrow-right"></i>
        </div>
      </>
  )
};

export default Tab;
